#include <iostream>
#include <vector>
#include <string>
#include <stack>

using namespace std;

class Solution {
public:
    string removeDuplicates(string s, int k) {
        stack<pair<char, int>> record;
        for (char i : s){
            if (record.empty()) record.push({i,1});
            else{
                pair<char, int> temp = record.top();
                if (temp.first == i){
                    record.pop();
                    if (temp.second < k-1) record.push({i, temp.second + 1});
                }
                else record.push({i, 1});
            }
        }
        string ans;
        while (!record.empty()){
            pair<char, int> temp = record.top();
            record.pop();
            for (int i = 0; i < temp.second; i++){
                ans += temp.first;
            }
        }
        reverse(ans.begin(), ans.end());
        return ans;
    }
};

int main(){
    string s = "deeedbbcccbdaa";
    int k = 3;
    // string s = "";
    // int k = 10000;
    Solution S;
    string ans = S.removeDuplicates(s, k);
    // cout << ans.length();
    for (auto i : ans) cout << i;
    cout << endl;
    return 0;
}